CREATE TABLE IF NOT EXISTS `cfpb_complaints_2500` (
  `Complaint ID` int(11) DEFAULT NULL,
  `Product` varchar(50) DEFAULT NULL,
  `Sub_product` varchar(50) DEFAULT NULL,
  `Issue` varchar(75) DEFAULT NULL,
  `Sub_issue` varchar(75) DEFAULT NULL,
  `ZIP_code` int(11) DEFAULT NULL,
  `State` char(5) DEFAULT NULL,
  `Submitted_via` varchar(20) DEFAULT NULL,
  `Data_received` date DEFAULT NULL,
  `Data_sent_to_company` date DEFAULT NULL,
  `Company` varchar(75) DEFAULT NULL,
  `Company_response` varchar(75) DEFAULT NULL,
  `Timely_response` varchar(10) DEFAULT NULL,
  `Consumer_disputed` varchar(10) DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;



